    e.exports = '<div class="privacy-policy-info"><div class="privacy-policy-info__header"><p class="title">隐私协议</p><div class="return-btn eqf-left"></div></div><div class="privacy-policy-info__content_ct"><div class="privacy-policy-info__content"><p class="headline">abc隐私权政策</p><div class="privacy-policy-main"><p class="bold-text">提示条款</p><p>您的信任对我们非常重要，我们深知个人信息对您的重要性，我们将按法律法规要求，采取相应安全保护措施，尽力保护您的个人信息安全可控。鉴于此，北京中abc企秀科技有限公司（简称“我们”或“abc”）制定本《abc隐私权政策》（下称“本政策/本隐私权政策”）并提醒您：</p><p class="line-wrap">本政策适用于abc提供的所有产品和服务。</p><p class="line-wrap"><span class="underline bold-text">在使用abc产品或服务前，请您务必仔细阅读并透彻理解本政策，特别是以粗体/粗体下划线标识的条款，您应重点阅读，在确认充分理解并同意后再开始使用。</span>如对本政策内容有任何疑问、意见或建议，您可通过abc官方客服与我们联系。本隐私权政策部分将帮助您了解以下内容：<br>一、我们如何收集和使用您的信息<br>二、我们如何使用Cookie或同类技术<br>三、我们如何共享、转让、公开披露您的信息<br>四、我们如何保护您的信息<br>五、您如何管理您的信息<br>六、我们如何处理未成年人的信息<br>七、通知和修订<br>八、如何联系我们<br></p><p class="bold-text">一、我们如何收集和使用您的信息</p><p>在您使用我们的产品及/或服务时，我们需要/可能需要收集和使用的您的个人信息包括如下两种：</p><p class="bold-text">1、为实现向您提供我们产品及/或服务的基本功能，您须授权我们收集、使用的必要的信息。如您拒绝提供相应信息，您将无法正常使用我们的产品及/或服务；</p><p class="bold-text">2、为实现向您提供我们产品及/或服务的附加功能，您可选择授权我们收集、使用的信息。如您拒绝提供，您将无法正常使用相关附加功能或无法达到我们拟达到的功能效果，但并不会影响您正常使用我们产品及/或服务的基本功能。</p><p class="underline bold-text">您理解并同意：</p><p class="bold-text">1、<span class="underline bold-text">我们致力于打造多样的产品和服务以满足您的需求。因我们向您提供的产品和服务种类众多，且不同用户选择使用的具体产品/服务范围存在差异，相应的，基本/附加功能及收集使用的个人信息类型、范围等会有所区别，请以具体的产品/服务功能为准；</span></p><p><span class="bold-text">2、<span class="underline">为给您带来更好的产品和服务体验，我们在持续努力改进我们的技术，随之我们可能会不时推出新的或优化后的功能，可能需要收集、使用新的个人信息或变更个人信息使用目的或方式。对此，我们将通过更新本政策、弹窗、页面提示等方式另行向您说明对应信息的收集目的、范围及使用方式，并为您提供自主选择同意的方式，且在征得您明示同意后收集、使用</span>。</span>在此过程中，如果您有任何疑问、意见或建议的，您可通过abc官方客服与我们联系，我们会尽快为您作出解答。</p><p>我们会为实现本政策下述的各项功能，收集和使用您的个人信息：</p><p class="bold-text">（一）用户注册</p><p>我们通过abc平台账户为您提供会员服务。为注册成为会员并使用我们的会员服务，您需要提供<span class="bold-text">手机号码/拟使用的会员名和密码</span>用于创建abc平台账户。如果您仅需使用浏览、搜索服务，您不需要注册成为我们的会员及提供上述信息。</p><p class="underline bold-text">对于需要通过abc平台账户才能使用的服务，我们可能会根据您提供的上述信息校验您的会员身份，确保我们是在为您本人提供服务。</p><p class="bold-text">（二）为您提供商品或服务信息展示</p><p class="underline bold-text">为了让您快速地找到您所需要的商品，我们可能会收集您使用我们的产品与/或服务的设备信息（包括设备名称、设备型号、操作系统）来为您提供商品信息展示的最优方式。我们也会为了不断改进和优化上述的功能来使用您的上述个人信息。</p><p>您也可以通过搜索来精准地找到您所需要的商品或服务。我们会保留您的搜索内容以方便您重复输入或为您展示与您搜索内容相关联的商品。<span class="underline bold-text">请您注意，您的搜索关键词信息无法单独识别您的身份，不属于您的个人信息，我们有权以任何的目的对其进行使用；只有当您的搜索关键词信息与您的其他信息相互结合使用并可以识别您的身份时，则在结合使用期间，我们会将您的搜索关键词信息作为您的个人信息，与您的搜索历史记录一同按照本隐私政策对其进行处理与保护。</span></p><p class="bold-text">（三）为您提供收藏、浏览、关注与分享功能</p><p>在您浏览我们网站的过程中，您可以选择对感兴趣的商品及/或服务进行收藏、通过我们提供的功能组件向其他第三方分享信息。在您使用上述功能的过程中，我们会收集包括您的收藏及分享历史在内等服务日志信息用于实现上述功能及其他我们明确告知的目的。</p><p class="bold-text">（四）帮助您完成支付</p><p>为完成订单支付，您需要选择付款方式，<span class="bold-text">我们会将您的abc平台账户会员名、对应的付款账户名、订单支付相关信息及其他法律法规要求的必要信息与付款账户共享。</span></p><p class="bold-text">（五）客服及争议处理</p><p>当您与我们联系或提出售中售后、争议纠纷处理申请时，为了保障您的账户及系统安全，<span class="underline bold-text">我们需要您提供必要的个人信息以核验您的会员身份。</span></p><p class="underline bold-text">为便于与您联系、尽快帮助您解决问题或记录相关问题的处理方案及结果，我们可能会保存您与我们的通信/通话记录及相关内容（包括账号信息、订单信息、您为了证明相关事实提供的其他信息，或您留下的联系方式信息），如果您针对具体订单进行咨询、投诉或提供建议的，我们会使用您的账号信息和订单信息。</p><p>为了提供服务及改进服务质量的合理需要，我们还可能使用的您的其他信息，包括您与客服联系时您提供的相关信息。</p><p class="bold-text">（六）为您提供评论、问答等信息公开发布功能</p><p>您可通过我们为您提供的评论、问答、论坛、及其他信息发布功能公开发布信息，包括作为会员可发布图文/视频内容、发表评价及问答内容。<br>我们可能会根据您的会员类型及网络日志信息判断您是否可享受对应功能权限（例如购买不同类型会员，享受不同的会员服务）。</p><p class="underline bold-text">请注意，您公开发布的信息中可能会涉及您或他人的个人信息甚至个人敏感信息，如您选择上传包含个人信息的图片，请您更加谨慎地考虑，是否在使用我们的服务时共享甚至公开分享相关信息。若您公开发布的信息中涉及儿童个人信息的，您需在发布前征得对应儿童监护人的同意。</p><p class="bold-text">（七）为您提供安全保障</p><p>为提高您使用我们提供服务的安全性，保护您或其他用户或公众的人身财产安全免遭侵害，更好地预防钓鱼网站、欺诈、网络漏洞、计算机病毒、网络攻击、网络侵入等安全风险，更准确地识别违反法律法规或abc相关协议规则的情况，我们可能使用或整合您的会员信息、交易信息、设备信息、服务日志信息或依据法律共享的信息，来综合判断您账户及交易风险、进行身份验证、检测及防范安全事件，并依法采取必要的记录、审计、分析、处置措施。</p><p class="bold-text">（八）向您提供商品或服务的信息展示和推送</p><p class="bold-text">（1）为您展示和推送商品或服务<br>基于您向我们提供的信息、我们可能收集的信息及我们通过间接方式收集到的您的信息（例如您的浏览及搜索记录、设备信息、订单信息），我们可能会基于用户行为分析及用户画像，用于提取您的浏览、搜索偏好、行为习惯、位置信息相关特征，以便向您提供更契合您需求的页面展示和推荐个性化内容。</p><p class="bold-text">（2）向您发出通知<br>我们可能在必需时（例如当我们由于系统维护而暂停某一单项服务、变更、终止提供某一单项服务时）向您发出与服务有关的通知。<br>如您不希望继续接收我们推送的消息，您可要求我们停止推送，例如：根据短信退订指引要求我们停止发送推广短信，或在移动端设备中进行设置，不再接收我们推送的消息；但我们依法律规定或发送消息的情形除外。</p><p class="bold-text">（九）其他</p><p class="underline bold-text">1、若你提供的信息中含有其他用户的个人信息，在向abc提供这些个人信息之前，您需确保您已经取得合法的授权。若其中涉及儿童个人信息的，您需在发布前取得对应儿童监护人的同意，前述情形下监护人有权通过官方电话联系我们，要求更正或删除涉及儿童个人信息的内容。</p><p class="underline bold-text">2、若我们将信息用于本政策未载明的其他用途，或者将基于特定目的收集而来的信息用于其他目的，或者我们主动从第三方处获取您的个人信息，均会事先获得您的同意。</p><p>3、征得授权同意的例外<br>您充分理解并同意，我们在以下情况下收集、使用您的个人信息无需您的授权同意，且我们可能不会响应您提出的更正/修改、删除、注销、撤回同意、索取信息的请求：<br>（1）与国家安全、国防安全有关的；<br>（2）与公共安全、公共卫生、重大公共利益有关的；<br>（3）与犯罪侦查、起诉、审判和判决执行等司法或行政执法有关的；<br>（4）出于维护您或其他个人的生命、财产等重大合法权益但又很难得到本人同意的；<br>（5）您自行向社会公众公开的个人信息；<br>（6）从合法公开披露的信息中收集个人信息的，如合法的新闻报道、政府信息公开等渠道。<br>（7）根据与您签订和履行相关协议或其他书面文件所必需的；<br>（8）用于维护所提供的产品及/或服务的安全稳定运行所必需的，例如发现、处置产品及/或服务的故障；<br>（9）为合法的新闻报道所必需的；<br>（10）学术研究机构基于公共利益开展统计或学术研究所必要，且对外提供学术研究或描述的结果时，对结果中所包含的个人信息进行去标识化处理的；<br>（11）法律法规规定的其他情形。</p><p>请知悉，根据适用的法律，若我们<span class="underline bold-text">对个人信息采取技术措施和其他必要措施进行处理，使得数据接收方无法重新识别特定个人且不能复原</span>，或我们可能会对收集的信息进行去标识化地研究、统计分析和预测，用于改善abc的内容和布局，为商业决策提供产品或服务支撑，以及改进我们的产品和服务（包括使用匿名数据进行机器学习或模型算法训练），<span class="underline bold-text">则此类处理后数据的使用无需另行向您通知并征得您的同意。</span></p><p>4、如我们停止运营abc产品或服务，我们将及时停止继续收集您个人信息的活动，将停止运营的通知以逐一送达或公告的形式通知您，并对我们所持有的与已关停业务相关的个人信息进行删除或匿名化处理。涉及儿童个人信息的，我们会并将停止运营的通知及时告知儿童监护人。</p><p class="bold-text">5、如果您拒绝表单创建者或者表单发布者收集、使用您的个人信息，请勿填写并并提交表格，我们严格遵守与您的约定，不会擅自使用您填写的表单信息。</p><p class="bold-text">二、我们如何使用Cookie或同类技术</p><p>为确保网站正常运转、为您获得更轻松的访问体验、向您推荐您可能感兴趣的内容，我们会在您的计算机或移动设备上存储Cookie、或浏览器（或关联应用程序）提供的其他通常包含标识符、站点名称以及一些号码和字符的本地存储（统称“Cookie”）。借助于 Cookie，网站能够存储您的偏好或购物车内的商品等数据。</p><p><span class="underline bold-text">如果您的浏览器或浏览器附加服务允许，您可修改对Cookie的接受程度或拒绝我们的Cookie。</span>但如果您这么做，在某些情况下可能会影响您安全访问我们的网站，且可能需要在每一次访问我们的网站时更改用户设置。</p><p class="bold-text">三、我们如何共享、转让、公开披露您的信息</p><p class="bold-text">（一）共享</p><p>我们不会与abc服务提供者以外的公司、组织和个人共享您的个人信息，但以下情况除外：</p><p>1、在法定情形下的共享：我们可能会根据法律法规规定、诉讼、争议解决需要，或按行政、司法机关依法提出的要求，对外共享您的个人信息。</p><p>2、在获取明确同意的情况下共享：获得您的明确同意后，我们会与其他方共享您的个人信息。</p><p>3、与授权合作伙伴共享：<span class="underline bold-text">我们可能委托授权合作伙伴为您提供某些服务或代表我们履行职能，</span>我们仅会出于本隐私权政策声明的合法、正当、必要、特定、明确的目的共享您的信息，授权合作伙伴只能接触到其履行职责所需信息，且不得将此信息用于其他任何目的。对于涉及儿童个人信息的，我们不允许合作伙伴进行转委托。</p><p>目前，我们的授权合作伙伴包括以下类型：</p><p>（1）广告、分析服务类的授权合作伙伴。除非得到您的许可，否则我们不会将您的个人身份信息与提供广告、分析服务的合作伙伴共享。我们会委托这些合作伙伴处理与广告覆盖面和有效性相关的信息，但不会提供您的个人身份信息，或者我们将这些信息进行去标识化处理，以便它不会识别您个人。这类合作伙伴可能将上述信息与他们合法获取的其他数据相结合，以执行我们委托的广告服务或决策建议。</p><p>（2）供应商、服务提供商和其他合作伙伴。我们将信息发送给支持我们业务的供应商、服务提供商和其他合作伙伴，这些支持包括受我们委托提供的技术基础设施服务、分析我们服务的使用方式、衡量广告和服务的有效性、提供客户服务、支付便利或进行学术研究和调查。</p><p>我们会对授权合作伙伴获取有关信息的应用程序接口（API）进行严格的安全检测，并与授权合作伙伴约定严格的数据保护措施，令其按照我们的委托目的、服务说明、本隐私权政策以及其他任何相关的保密和安全措施来处理个人信息。</p><p class="bold-text">（二）转让</p><p>我们不会将您的个人信息转让给任何公司、组织和个人，但以下情况除外：</p><p>1、在获取明确同意的情况下转让：获得您的明确同意后，我们会向其他方转让您的个人信息；</p><p>2、在abc服务提供者发生合并、收购或破产清算情形，或其他涉及合并、收购或破产清算情形时，如涉及到个人信息转让，我们会要求新的持有您个人信息的公司、组织继续受本政策的约束，否则我们将要求该公司、组织和个人重新向您征求授权同意。</p><p class="bold-text">（三）公开披露</p><p>我们仅会在以下情况下，公开披露您的个人信息：</p><p>1、获得您明确同意或基于您的主动选择，我们可能会公开披露您的个人信息；</p><p>2、<span class="underline bold-text">如果我们确定您出现违反法律法规或严重违反abc平台相关协议及规则的情况，或为保护abc平台用户或公众的人身财产安全免遭侵害，我们可能依据法律法规或征得您同意的情况下披露关于您的个人信息</span>，包括相关违规行为以及abc平台已对您采取的措施。例如，若您因出售假冒商品而严重违反abc规则，我们可能会公开披露您的店铺认证主体信息与违规情况。</p><p class="bold-text">（四）共享、转让、公开披露个人信息时事先征得授权同意的例外</p><p>以下情形中，共享、转让、公开披露您的个人信息无需事先征得您的授权同意：</p><p>1、与国家安全、国防安全有关的；<br>2、与公共安全、公共卫生、重大公共利益有关的；<br>3、与犯罪侦查、起诉、审判和判决执行等司法或行政执法有关的；<br>4、出于维护您或其他个人的生命、财产等重大合法权益但又很难得到本人同意的；<br>5、您自行向社会公众公开的个人信息；<br>6、从合法公开披露的信息中收集个人信息的，如合法的新闻报道、政府信息公开等渠道。</p><p>请知悉，根据适用的法律，若我们<span class="underline bold-text">对个人信息采取技术措施和其他必要措施进行处理，使得数据接收方无法重新识别特定个人且不能复原，则此类处理后数据的共享、转让、公开披露无需另行向您通知并征得您的同意。</span></p><p class="bold-text">四、我们如何保护您的信息</p><p>（一）我们已采取符合业界标准、合理可行的安全防护措施保护您的信息，防止个人信息遭到未经授权访问、公开披露、使用、修改、损坏或丢失。我们会使用加密技术提高个人信息的安全性；我们会使用受信赖的保护机制防止个人信息遭到恶意攻击；我们会部署访问控制机制，尽力确保只有授权人员才可访问个人信息；以及我们会举办安全和隐私保护培训课程，加强员工对于保护个人信息重要性的认识。</p><p>（二）我们有行业先进的以数据为核心、围绕数据生命周期进行的数据安全管理体系，从组织建设、制度设计、人员管理、产品技术等方面多维度提升整个系统的安全性。</p><p>（三）我们会采取合理可行的措施，尽力避免收集无关的个人信息。<span class="underline bold-text">我们只会在达成本政策所述目的所需的期限内保留您的个人信息，除非法律有强制的存留要求，</span><span class="bold-text">而我们判断前述期限的标准包括：</span></p><p class="bold-text">1、完成与您相关的交易目的、维护相应交易及业务记录、应对您可能的查询或投诉；<br>2、保证我们为您提供服务的安全和质量；<br>3、您是否同意更长的留存期间；<br>4、是否存在保留期限的其他特别约定。</p><p class="underline bold-text">在您的个人信息超出保留期间后，我们会根据适用法律的要求删除您的个人信息。</p><p>（四）互联网并非绝对安全的环境，使用abc平台服务时，<span class="underline bold-text">我们强烈建议您不要使用非abc平台推荐的通信方式发送您的信息。</span>您可以通过我们的服务建立联系和相互分享。当您通过我们的服务创建交流、交易或分享时，您可以自主选择沟通、交易或分享的对象，作为能够看到您的交易内容、联络方式、交流信息或分享内容等相关信息的第三方。</p><p>请使用复杂密码，协助我们保证您的账号安全。我们将尽力保障您发送给我们的任何信息的安全性。如果我们的物理、技术或管理防护设施遭到破坏，导致信息被非授权访问、公开披露、篡改或毁坏，导致您的合法权益受损，我们将承担相应的法律责任。</p><p>（五）在不幸发生个人信息安全事件后，我们将按照法律法规的要求向您告知：安全事件的基本情况和可能的影响、我们已采取或将要采取的处置措施、您可自主防范和降低风险的建议、对您的补救措施等。事件相关情况我们将以邮件、信函、电话、推送通知等方式告知您，难以逐一告知个人信息主体时，我们会采取合理、有效的方式发布公告。</p><p>同时，我们还将按照监管部门要求，上报个人信息安全事件的处置情况。</p><p class="bold-text">五、您如何管理您的信息</p><p>您可以通过以下方式访问及管理您的信息：</p><p class="bold-text">（一）查询、更正和补充您的信息</p><p class="bold-text">我们鼓励您更新和修改您的个人信息以使其更准确有效。您能通过abc服务访问您的个人信息，并根据对应信息的管理方式自行完成或要求我们进行修改、补充和删除。我们将采取适当的技术手段或提供提交申请的联系渠道，尽可能保证您可以访问、更新和更正自己的个人信息或使用abc服务时提供的其他信息。</p><p class="bold-text">（二）注销您的账户</p><p>您可以登录abc并选择联系客服协助您申请注销您的账户。</p><p>在您主动注销账户之后，我们将停止为您提供产品或服务，根据适用法律的要求删除您的个人信息，或使其匿名化处理。</p><p class="bold-text">（三）响应您的上述请求</p><p>为保障安全，您可能需要提供书面请求，或以其他方式证明您的身份。我们可能会先要求您验证自己的身份，然后再处理您的请求。</p><p>在以下情形中，按照法律法规要求，我们将无法响应您的请求：</p><p>1、与国家安全、国防安全有关的；<br>2、与公共安全、公共卫生、重大公共利益有关的；<br>3、与犯罪侦查、起诉、审判和执行判决等有关的；<br>4、有充分证据表明个人信息主体存在主观恶意或滥用权利的；<br>5、响应您的请求将导致您或其他个人、组织的合法权益受到严重损害的；<br>6、涉及商业秘密的。</p><p class="bold-text">六、我们如何处理未成年人的信息</p><p class="underline bold-text">在abc商务活动中我们推定您具有相应的民事行为能力。如您为未成年人，我们要求您请您的父母或其他监护人仔细阅读本隐私权政策，并在征得您的父母或其他监护人同意的前提下使用我们的服务或向我们提供信息。</p><p class="underline bold-text">如果我们识别出您是儿童用户的，我们将通知您的监护人并要求您的监护人同意儿童个人信息收集使用规则。对于经父母或其他监护人同意使用我们的产品或服务而收集儿童个人信息的情况，我们只会在法律法规允许、父母或其他监护人明确同意或者保护儿童所必要的情况下使用、共享、转让或披露此信息。</p><p><span class="underline bold-text">若您是儿童的父母或其他监护人，请您关注您监护的儿童是否是在取得您的授权同意之后使用我们的服务的。</span>如您对您所监护的儿童的个人信息有疑问，请通过官方联系方式与我们联系。</p><p class="bold-text">七、通知和修订</p><p>为了给您提供更好的服务，我们可能会根据abc服务的更新情况及法律法规的相关要求适时修改本政策的条款，该等修改构成本政策的一部分。如该等更新造成您在本政策下权利的实质减少或重大变更，我们将在本政策生效前通过网站公告、推送通知、弹窗提示或其他方式来通知您，您如果不同意该等变更，可以选择停止使用abc服务；如您仍然继续使用abc服务的，即表示您已充分阅读、理解并同意受经修订的本政策的约束。</p><p>我们的任何修改都会将您的满意度置于首位。我们鼓励您在每次使用abc服务时都查阅我们的隐私政策。</p><p>我们可能在必需时（例如当我们由于系统维护而暂停某一项服务时）发出与服务有关的公告。您可能无法取消这些与服务有关、性质不属于推广的公告。</p><p class="bold-text">八、如何联系我们</p><p>如您有关于网络信息安全的投诉和举报，或您对本政策、abc的隐私措施、您的信息的相关事宜有任何问题、意见或建议，请通过如下方式及时与abc联系：客服电话：010-56592226；客服咨询： vip@abciu.com。</p><p>一般情况下，我们将在收到您的问题、意见或建议，并验证您的用户身份后的三十天内予以回复。</p></div></div></div></div>'
